import React, { useState, useEffect } from 'react';
import axios from 'axios';

function ViewTrack() {
  const [entry, setEntry] = useState([]);

  useEffect(() => {
    fetchEntry();
  }, []);

  const fetchEntry = () => {
    axios
      .get('http://localhost:4000/race/track/all')
      .then((res) => setEntry(res))
      .catch((err) => setEntry(err));
  };
  return (
    <div>
      <h1>View</h1>
      <div>
        <div>
          {entry ? (
            entry.map((item) => {
              return (
                <div key={item._id}>
                  <h1>{item.name}</h1>
                </div>
              );
            })
          ) : (
            <h1>Nu</h1> )}
        </div>
      </div>
    </div>
  );
}

export default ViewTrack;
